class IntroText {
  constructor(id, title, subtitle, color, imageUrl) {
    this.id = id;
    this.title = title;
    this.subtitle = subtitle;
    this.color = color;
    this.imageUrlDesktop = imageUrl;
    this.imageUrl = imageUrl;
  }
}

export default IntroText;
